import React from 'react';
import './App.css';
import { OurMenu } from './menu-zone';

function App() {
  return (
	<React.Fragment>
		<div>
			<header className="Header">

			</header>
		</div>
		<div className='Menu'>
			<OurMenu/>
		</div>
		<div>
			<Router>
				<Route path="/">
					<Home />
				</Route>
			</Router>
			<Router>
				<Route path="/chat">
					<Chat />
				</Route>
			</Router>
		</div>
	</React.Fragment>

  );
}

export default App;
